const Contracts = Type.Module({
  MultisigScript: Type.Union([
    Type.Object({
      Signature: Type.Object({
        key_hash: Type.String(),
      }, { ctor: 0n })
    }),
    Type.Object({
      AllOf: Type.Object({
        scripts: Type.Array(
          Type.Ref("MultisigScript")
        ),
      }, { ctor: 1n })
    }),
    Type.Object({
      AnyOf: Type.Object({
        scripts: Type.Array(
          Type.Ref("MultisigScript")
        ),
      }, { ctor: 2n })
    }),
    Type.Object({
      AtLeast: Type.Object({
        required: Type.BigInt(),
        scripts: Type.Array(
          Type.Ref("MultisigScript")
        ),
      }, { ctor: 3n })
    }),
    Type.Object({
      Before: Type.Object({
        time: Type.BigInt(),
      }, { ctor: 4n })
    }),
    Type.Object({
      After: Type.Object({
        time: Type.BigInt(),
      }, { ctor: 5n })
    }),
    Type.Object({
      Script: Type.Object({
        script_hash: Type.String(),
      }, { ctor: 6n })
    }),
  ]),
  Payout: Type.Object({
    maturation: Type.BigInt(),
    value: Type.Record(
      Type.String(),
      Type.Record(
        Type.String(),
        Type.BigInt(),
      ),
    ),
    status: Type.Ref("PayoutStatus"),
  }, { ctor: 0n }),
  PayoutStatus: Type.Union([
    Type.Literal("Active", { ctor: 0n }),
    Type.Literal("Paused", { ctor: 1n }),
  ]),
  ScriptHashRegistry: Type.Object({
    treasury: Type.Union([
      Type.Object({
        VerificationKey: Type.Tuple([
          Type.String(),
        ], { ctor: 0n })
      }),
      Type.Object({
        Script: Type.Tuple([
          Type.String(),
        ], { ctor: 1n })
      }),
    ]),
    vendor: Type.Union([
      Type.Object({
        VerificationKey: Type.Tuple([
          Type.String(),
        ], { ctor: 0n })
      }),
      Type.Object({
        Script: Type.Tuple([
          Type.String(),
        ], { ctor: 1n })
      }),
    ]),
  }, { ctor: 0n }),
  TreasuryConfiguration: Type.Object({
    registry_token: Type.String(),
    permissions: Type.Ref("TreasuryPermissions"),
    expiration: Type.BigInt(),
    payout_upperbound: Type.BigInt(),
  }, { ctor: 0n }),
  TreasuryPermissions: Type.Object({
    reorganize: Type.Ref("MultisigScript"),
    sweep: Type.Ref("MultisigScript"),
    fund: Type.Ref("MultisigScript"),
    disburse: Type.Ref("MultisigScript"),
  }, { ctor: 0n }),
  TreasurySpendRedeemer: Type.Union([
    Type.Literal("Reorganize", { ctor: 0n }),
    Type.Literal("SweepTreasury", { ctor: 1n }),
    Type.Object({
      Fund: Type.Object({
        amount: Type.Record(
          Type.String(),
          Type.Record(
            Type.String(),
            Type.BigInt(),
          ),
        ),
      }, { ctor: 2n })
    }),
    Type.Object({
      Disburse: Type.Object({
        amount: Type.Record(
          Type.String(),
          Type.Record(
            Type.String(),
            Type.BigInt(),
          ),
        ),
      }, { ctor: 3n })
    }),
  ]),
  VendorConfiguration: Type.Object({
    registry_token: Type.String(),
    permissions: Type.Ref("VendorPermissions"),
    expiration: Type.BigInt(),
  }, { ctor: 0n }),
  VendorDatum: Type.Object({
    vendor: Type.Ref("MultisigScript"),
    payouts: Type.Array(
      Type.Ref("Payout")
    ),
  }, { ctor: 0n }),
  VendorPermissions: Type.Object({
    pause: Type.Ref("MultisigScript"),
    resume: Type.Ref("MultisigScript"),
    modify: Type.Ref("MultisigScript"),
  }, { ctor: 0n }),
  VendorSpendRedeemer: Type.Union([
    Type.Literal("Withdraw", { ctor: 0n }),
    Type.Object({
      Adjudicate: Type.Object({
        statuses: Type.Array(
          Type.Ref("PayoutStatus")
        ),
      }, { ctor: 1n })
    }),
    Type.Literal("Modify", { ctor: 2n }),
    Type.Literal("SweepVendor", { ctor: 3n }),
    Type.Literal("Malformed", { ctor: 4n }),
  ]),
});

export const MultisigScript = Contracts.Import("MultisigScript");
